import React from "react";

export interface InputProps {
  onchange: any
  dataAttr: any
}

function Input({onchange, dataAttr}: InputProps) {
  return(
    <div>
      <input
        type='text' 
        onChange={onchange}
        data-name={dataAttr}/>
    </div>
  )
}

export default Input
